function tensor_inverse5(A::AbstractArray{T, 3}) where T 
    out = similar(A)

    tensor_inverse5!(out, A)
    
    out 
end

function tensor_inverse5!(out::AbstractArray{T, 3}, A::AbstractArray{T, 3}) where T 
    @assert size(A, 1) == size(A, 2) == 5
    @assert size(A) == size(out)

    backend = get_backend(out)
    inv55! = inv55_kernel!(backend)

    inv55!(out, A, ndrange = size(A, 3))

    nothing
end

function ChainRulesCore.rrule(::typeof(tensor_inverse5), A::AT) where {T, AT<:AbstractArray{T, 3}}
    out = tensor_inverse5(A)
    
    function tensor_inverse_pullback(out_diff::AT)

        NoTangent(), - tensor_transpose_tensor_mul(out, tensor_tensor_mul(out_diff, tensor_transpose(out)))
    end 
    out, tensor_inverse_pullback 
end 
